import React, { Component } from 'react';
import './App.css';
var style={
  width:50,
  height:50,
  borderRadius:50,
  background:"yellow",
}
var cellStyle={
  background:"red",
  padding:2,
  display:"inline"
}
class Circle extends Component{
  render(){
    return( <div style={style}></div>)
  }
}
class Cell extends Component{
  // constructor(props){
  //   super(props){}

  // }
  render(){
    return(<div style={cellStyle}>
  <Circle />
    </div>)
  }
}
class Row extends Component{
render(){
  var row1=[]
  for (let i = 0 ; i < 5 ; i++){row1.push(<Cell />)}

  return(row1)
}

}

class App extends Component {
  render() {
    return (
      <div className="App">
        <header className="App-header">
        <Row />
        </header>
      </div>
    );
  }
}

export default App;
